DROP DATABASE IF EXISTS football_db;
CREATE DATABASE football_db;
USE football_db;
CREATE TABLE dsPartidosYGoles ( 
id int,matches_tournament_id varchar (255),
matches_match_id varchar (255),
matches_away_team_id varchar (255),
matches_home_team_id varchar (255),
matches_stadium_id varchar (255),
matches_match_date varchar (255),
matches_match_time varchar (255),
matches_stage_name varchar (255),
matches_home_team_score int,
matches_away_team_score int,
matches_extra_time int,
matches_penalty_shootout int,
matches_home_team_score_penalties int,
matches_away_team_score_penalties int,
matches_result varchar (255),
tournaments_tournament_name varchar (255),
tournaments_year int,
tournaments_host_country varchar (255),
tournaments_winner varchar (255),
tournaments_count_teams int,
stadiums_stadium_name varchar (255),
stadiums_city_name varchar (255),
stadiums_country_name varchar (255),
stadiums_stadium_capacity int,
home_team_name varchar (255),
home_mens_team int,
home_womens_team int,
home_region_name varchar (255),
away_team_name varchar (255),
away_mens_team int,
away_womens_team int,
away_region_name varchar (255),
goals_goal_id varchar (255),
goals_team_id varchar (255),
goals_player_id varchar (255),
goals_player_team_id varchar (255),
goals_minute_label varchar (255),
goals_minute_regulation int,
goals_minute_stoppage int,
goals_match_period varchar (255),
goals_own_goal int,
goals_penalty int
);

CREATE TABLE `dsalineacionesxtorneo` (
  `id` int NOT NULL AUTO_INCREMENT,
  `squads_player_id` varchar(255) DEFAULT NULL,
  `squads_tournament_id` varchar(255) DEFAULT NULL,
  `squads_team_id` varchar(255) DEFAULT NULL,
  `squads_shirt_number` int DEFAULT NULL,
  `squads_position_name` varchar(255) DEFAULT NULL,
  `players_family_name` varchar(255) DEFAULT NULL,
  `players_given_name` varchar(255) DEFAULT NULL,
  `players_birth_date` varchar(255) DEFAULT NULL,
  `players_female` int DEFAULT NULL,
  `players_goal_keeper` int DEFAULT NULL,
  `players_defender` int DEFAULT NULL,
  `players_midfielder` int DEFAULT NULL,
  `players_forward` int DEFAULT NULL,
  PRIMARY KEY (`id`)
);
CREATE TABLE `generos` (
  `id_genero` tinyint unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(1) NOT NULL,
  PRIMARY KEY (`id_genero`)
) ;

CREATE TABLE `paises` (
  `id_pais` smallint unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) NOT NULL,
  PRIMARY KEY (`id_pais`)
);

CREATE TABLE `equipos` (
  `id_equipo` smallint unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) NOT NULL,
  `codigo` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id_equipo`)
);

CREATE TABLE `jugadores` (
  `id_jugador` mediumint NOT NULL AUTO_INCREMENT,
  `nombres` varchar(50) NOT NULL,
  `apellidos` varchar(100) NOT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `id_genero` int DEFAULT NULL,
  `codigo` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id_jugador`)
);

CREATE TABLE `jugador_equipo` (
  `id` smallint unsigned NOT NULL AUTO_INCREMENT,
  `id_jugador` mediumint NOT NULL,
  `id_genero_jugador` tinyint unsigned DEFAULT NULL,
  `id_equipo` smallint unsigned NOT NULL,
  `id_genero_equipo` tinyint unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `jugador_equipo_ibfk_2_idx` (`id_equipo`),
  KEY `jugador_equipo_ibfk_1_idx` (`id_jugador`),
  CONSTRAINT `jugador_equipo_ibfk_1` FOREIGN KEY (`id_jugador`) REFERENCES `jugadores` (`id_jugador`),
  CONSTRAINT `jugador_equipo_ibfk_2` FOREIGN KEY (`id_equipo`) REFERENCES `equipos` (`id_equipo`)
);

CREATE TABLE `torneos` (
  `id_torneo` smallint unsigned NOT NULL AUTO_INCREMENT,
  `codigo` varchar(45) DEFAULT NULL,
  `nombre` varchar(100) NOT NULL,
  `anio` year NOT NULL,
  `id_genero` tinyint unsigned NOT NULL,
  `id_pais_sede` smallint unsigned NOT NULL,
  PRIMARY KEY (`id_torneo`),
  KEY `id_genero` (`id_genero`),
  KEY `id_pais_sede` (`id_pais_sede`),
  CONSTRAINT `torneos_ibfk_1` FOREIGN KEY (`id_genero`) REFERENCES `generos` (`id_genero`),
  CONSTRAINT `torneos_ibfk_2` FOREIGN KEY (`id_pais_sede`) REFERENCES `paises` (`id_pais`)
);

CREATE TABLE `equipo_torneo` (
  `id` smallint unsigned NOT NULL AUTO_INCREMENT,
  `id_equipo` smallint unsigned NOT NULL,
  `id_torneo` smallint unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_torneo` (`id_torneo`),
  KEY `equipo_torneo_ibfk_1_idx` (`id_equipo`),
  CONSTRAINT `equipo_torneo_ibfk_1` FOREIGN KEY (`id_equipo`) REFERENCES `equipos` (`id_equipo`),
  CONSTRAINT `equipo_torneo_ibfk_2` FOREIGN KEY (`id_torneo`) REFERENCES `torneos` (`id_torneo`)
);

CREATE TABLE `convocados` (
  `id_convocado` bigint NOT NULL AUTO_INCREMENT,
  `id_jugador_equipo` smallint unsigned NOT NULL,
  `id_torneo` smallint unsigned NOT NULL,
  `numero_camiseta` tinyint unsigned NOT NULL,
  `posicion` varchar(50) NOT NULL,
  PRIMARY KEY (`id_convocado`),
  KEY `id_jugador_equipo` (`id_jugador_equipo`),
  KEY `id_torneo` (`id_torneo`),
  CONSTRAINT `convocados_ibfk_1` FOREIGN KEY (`id_jugador_equipo`) REFERENCES `jugador_equipo` (`id`),
  CONSTRAINT `convocados_ibfk_2` FOREIGN KEY (`id_torneo`) REFERENCES `torneos` (`id_torneo`)
);

CREATE TABLE `estadios` (
  `id_estadio` smallint unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) NOT NULL,
  `ciudad` varchar(100) NOT NULL,
  `id_pais` smallint unsigned NOT NULL,
  `capacidad` mediumint NOT NULL,
  PRIMARY KEY (`id_estadio`),
  KEY `id_pais` (`id_pais`),
  CONSTRAINT `estadios_ibfk_1` FOREIGN KEY (`id_pais`) REFERENCES `paises` (`id_pais`)
);

CREATE TABLE `partidos` (
  `id_partido` mediumint NOT NULL AUTO_INCREMENT,
  `id_torneo` smallint unsigned NOT NULL,
  `id_equipo_local` smallint unsigned NOT NULL,
  `id_equipo_visitante` smallint unsigned NOT NULL,
  `id_estadio` smallint unsigned NOT NULL,
  `fecha` date NOT NULL,
  `hora` time NOT NULL,
  `etapa` varchar(50) NOT NULL,
  `goles_local` tinyint unsigned NOT NULL,
  `goles_visitante` tinyint unsigned NOT NULL,
  `tiempo_extra` tinyint NOT NULL,
  `penales` tinyint NOT NULL,
  PRIMARY KEY (`id_partido`),
  KEY `id_torneo` (`id_torneo`),
  KEY `id_equipo_local` (`id_equipo_local`),
  KEY `id_equipo_visitante` (`id_equipo_visitante`),
  KEY `id_estadio` (`id_estadio`),
  CONSTRAINT `partidos_ibfk_1` FOREIGN KEY (`id_torneo`) REFERENCES `torneos` (`id_torneo`),
  CONSTRAINT `partidos_ibfk_2` FOREIGN KEY (`id_equipo_local`) REFERENCES `equipo_torneo` (`id`),
  CONSTRAINT `partidos_ibfk_3` FOREIGN KEY (`id_equipo_visitante`) REFERENCES `equipo_torneo` (`id`),
  CONSTRAINT `partidos_ibfk_4` FOREIGN KEY (`id_estadio`) REFERENCES `estadios` (`id_estadio`)
);

CREATE TABLE `goles` (
  `id_gol` mediumint NOT NULL AUTO_INCREMENT,
  `id_partido` mediumint NOT NULL,
  `id_jugador_equipo` smallint unsigned NOT NULL,
  `minuto` tinyint unsigned NOT NULL,
  `periodo` enum('P','ST') NOT NULL,
  `tipo` enum('Normal','Penalty','En contra') NOT NULL,
  PRIMARY KEY (`id_gol`),
  KEY `id_partido` (`id_partido`),
  KEY `id_jugador_equipo` (`id_jugador_equipo`),
  CONSTRAINT `goles_ibfk_1` FOREIGN KEY (`id_partido`) REFERENCES `partidos` (`id_partido`),
  CONSTRAINT `goles_ibfk_2` FOREIGN KEY (`id_jugador_equipo`) REFERENCES `convocados` (`id_jugador_equipo`)
);






SELECT distinct stadiums_country_name FROM football_db.dspartidosygoles;

SELECT distinct stadiums_stadium_name, stadiums_city_name, (select id_pais from football_db.paises p where p.nombre = d.stadiums_country_name), stadiums_stadium_capacity FROM football_db.dspartidosygoles d;

SELECT
  DISTINCT 
  matches_tournament_id AS codigo,
  tournaments_tournament_name AS nombre, 
  tournaments_year AS anio,
  CASE WHEN tournaments_tournament_name LIKE '% Men%' THEN 1 ELSE 2 END AS id_genero,
  (
    SELECT MAX(id_pais) 
    FROM football_db.paises p
    WHERE p.nombre = d.stadiums_country_name
  ) AS id_pais_sede FROM football_db.dspartidosygoles d;


select distinct matches_home_team_id, home_team_name from football_db.dspartidosygoles 
union select distinct matches_away_team_id, away_team_name from football_db.dspartidosygoles;


select distinct e.id_equipo, t.id_torneo from 
    football_db.equipos e,
    football_db.torneos t,
	football_db.dspartidosygoles d
where
	e.nombre = d.home_team_name and
    t.nombre = d.tournaments_tournament_name
union
select distinct e.id_equipo, t.id_torneo
from
	football_db.equipos e,
    football_db.torneos t,
	football_db.dspartidosygoles d
where
	e.nombre = d.away_team_name and
    t.nombre = d.tournaments_tournament_name;
	

select
	t.id_torneo,
    elt.id,
    evt.id,
    es.id_estadio,
    d.matches_match_date,
    d.matches_match_time,
    d.matches_stage_name,
    d.matches_home_team_score,
    d.matches_away_team_score,
    d.matches_extra_time,
    d.matches_penalty_shootout 
from
    football_db.torneos t,
    football_db.paises p,   
	football_db.equipos el,
    football_db.equipo_torneo elt,
    football_db.equipos ev,
    football_db.equipo_torneo evt,
    football_db.estadios es,
    football_db.dspartidosygoles d
where
	t.nombre = d.tournaments_tournament_name and
    t.id_pais_sede = p.id_pais and
    p.nombre = stadiums_country_name and
    el.nombre = d.home_team_name and
    ev.nombre = d.away_team_name and
    elt.id_equipo = el.id_equipo and
    elt.id_torneo = t.id_torneo and
    evt.id_equipo = ev.id_equipo and
    evt.id_torneo = t.id_torneo and
    es.nombre = d.stadiums_stadium_name and
    es.ciudad = d.stadiums_city_name;
	
	
select distinct 
	squads_player_id,
	players_given_name, 
    players_family_name, 
    case when players_birth_date = 'not available' or players_birth_date = '' then null else date(players_birth_date) end,  
    case players_female when 1  then 2 else 1 end
from dsalineacionesxtorneo;

select distinct j.id_jugador, e.id_equipo 
from
	jugadores j,
    equipos e,
    dsalineacionesxtorneo d
where
	j.codigo = d.squads_player_id and
    e.codigo = d.squads_team_id;




select je.id, t.id_torneo, d.squads_shirt_number, d.squads_position_name 
from
		jugador_equipo je,
        jugadores j,
        torneos t,
        dsalineacionesxtorneo d
        where 
        je.id_jugador = j.id_jugador 
        and   j.codigo = d.squads_player_id 
        and   t.codigo = d.squads_tournament_id;



    







    
	
